import{_ as r,o as t,c as e,a as o}from"./app.0e46eb75.js";const S=JSON.parse('{"title":"\u4E0D\u5FEB\u4E50\u7684\u5FC3\u7406\u56E0\u7D20","description":"","frontmatter":{"updateTime":"2015/08/03","title":"\u4E0D\u5FEB\u4E50\u7684\u5FC3\u7406\u56E0\u7D20"},"headers":[],"relativePath":"ESSAY/sevenNoHappyFactors.md"}'),a={name:"ESSAY/sevenNoHappyFactors.md"},s=o('<blockquote><p>\u6CA1\u6709\u4EBA\u80FD\u591F\u6C38\u8FDC\u5FEB\u4E50\u5F00\u5FC3\u7684\uFF0C\u4EBA\u603B\u4F1A\u6709\u6D88\u6781\u60B2\u89C2\u7684\u65F6\u5019\uFF0C\u8FD9\u90FD\u662F\u6B63\u5E38\u7684\u3002\u5173\u952E\u662F\u8981\u770B\uFF0C\u8981\u5728\u8FD9\u6D88\u6781\u548C\u60B2\u89C2\u4E2D\u6C89\u6D78\u591A\u957F\u65F6\u95F4\uFF0C\u591A\u5FEB\u80FD\u8D70\u51FA\u60B2\u89C2\u548C\u6D88\u6781\u3002\u6BCF\u5929\u7EC3\u4E60\u7528\u79EF\u6781\u7684\u6001\u5EA6\u53BB\u770B\u5F85\u4E16\u754C\uFF0C\u770B\u5F85\u95EE\u9898\uFF0C\u5C31\u4F1A\u8BA9\u4F60\u7684\u4EBA\u751F\u53D8\u5F97\u5FEB\u4E50\u3002</p></blockquote><h1 id="\u4E03\u4E2A\u8BA9\u4F60\u957F\u671F\u4E0D\u5FEB\u4E50\u7684\u5FC3\u7406\u56E0\u7D20" tabindex="-1">\u4E03\u4E2A\u8BA9\u4F60\u957F\u671F\u4E0D\u5FEB\u4E50\u7684\u5FC3\u7406\u56E0\u7D20 <a class="header-anchor" href="#\u4E03\u4E2A\u8BA9\u4F60\u957F\u671F\u4E0D\u5FEB\u4E50\u7684\u5FC3\u7406\u56E0\u7D20" aria-hidden="true">#</a></h1><p>\u8BA9\u81EA\u5DF1\u5E38\u5E38\u5904\u4E8E\u5F00\u5FC3\u7684\u72B6\u6001\uFF0C\u4E0D\u4EC5\u8BA9\u81EA\u5DF1\u8FC7\u5F97\u66F4\u5FEB\u6D3B\uFF0C\u4E5F\u4F1A\u4F7F\u81EA\u5DF1\u66F4\u5177\u9B45\u529B\uFF0C\u56E0\u4E3A\u5927\u591A\u6570\u4EBA\u662F\u66F4\u613F\u610F\u548C\u4E50\u89C2\u3001\u79EF\u6781\u3001\u5FEB\u4E50\u7684\u4EBA\u505A\u670B\u53CB\u7684\u3002\u548C\u5FEB\u4E50\u7684\u4EBA\u5728\u4E00\u8D77\uFF0C\u5FEB\u4E50\u7684\u60C5\u7EEA\u4E5F\u4F1A\u4F20\u67D3\uFF1B\u5F53\u4F60\u548C\u5FEB\u4E50\u7684\u4EBA\u5171\u5904\u4E00\u5BA4\uFF0C\u80FD\u611F\u89C9\u4ED6\u4EEC\u79EF\u6781\u4E50\u89C2\u7684\u6C1B\u56F4\uFF0C\u5BF9\u5F53\u4E0B\u7684\u4E8B\u60C5\uFF0C\u5BF9\u5F53\u4E0B\u7684\u751F\u6D3B\u611F\u5230\u5174\u594B\uFF0C\u611F\u6069\u76EE\u524D\u62E5\u6709\u7684\u4E00\u5207\uFF0C\u5BF9\u672A\u6765\u5145\u6EE1\u671F\u5F85\u548C\u61A7\u61AC\u3002<br> \u3000\u3000\u5982\u4F55\u8BA9\u81EA\u5DF1\u5FEB\u4E50\uFF1F\u4E2D500W\u5F69\u7968\uFF1F\u5347\u804C\u52A0\u85AA\u8FCE\u5A36\u767D\u5BCC\u7F8E\uFF1F\u4E70\u8F86\u9AD8\u7EA7\u8DD1\u8F66\uFF1F\u5148\u4E0D\u8003\u8651\u80FD\u5426\u5B9E\u73B0\uFF0C\u5373\u4F7F\u80FD\u5B9E\u73B0\uFF0C\u8FD9\u5BF9\u5927\u591A\u6570\u4EBA\u4E5F\u4E0D\u662F\u4E00\u65F6\u534A\u4F1A\u5C31\u80FD\u5B9E\u73B0\u7684\uFF1B\u7269\u8D28\u7684\u523A\u6FC0\u53EA\u80FD\u7EF4\u6301\u77ED\u6682\u7684\u5F00\u5FC3\uFF0C\u4EBA\u4E0D\u4F1A\u53D8\u5F97\u771F\u6B63\u7684\u4E50\u89C2\u8D77\u6765\u3002<br> \u3000\u3000\u7F8E\u56FD\u52A0\u5DDE\u5927\u5B66\u7814\u7A76\u5E78\u798F\u611F\u7684\u5FC3\u7406\u5B66\u4E13\u5BB6 Sonja Lyubomirsky \u535A\u58EB\u8BF4\u8FC7\uFF0C\u5E78\u798F\u611F\u7684\u51B3\u5B9A\u6743\uFF0C50%\u662F\u6E90\u4E8E\u57FA\u56E0\uFF0C\u6709\u7684\u4EBA\u771F\u662F\u5929\u751F\u5C31\u6709\u4E00\u79CD\u201C\u5FEB\u4E50\u57FA\u56E0\u201D\u7684\uFF0C\u771F\u662F\u5E78\u798F\u7684\u4EBA\uFF1B\u670910%\uFF0C\u662F\u6E90\u4E8E\u6C1B\u56F4\u3001\u4E2A\u4EBA\u6761\u4EF6\u3001\u7269\u8D28\u4E0A\u7684\u4E1C\u897F\uFF0C\u4EE5\u53CA\u662F\u5426\u6709\u597D\u7684\u8EAB\u4F53\uFF0C\u6709\u597D\u7684\u9645\u9047\uFF1B\u800C\u4F59\u4E0B40%\uFF0C\u76F8\u5F53\u5927\u7684\u90E8\u5206\uFF0C\u662F\u4EBA\u4EEC\u7684\u5FC3\u7406\u56E0\u7D20\uFF0C\u8FD9\u662F\u638C\u63E1\u5728\u6211\u4EEC\u624B\u4E2D\u3001\u53EF\u63A7\u7684\u3002<br> \u3000\u3000\u957F\u671F\u9677\u4E8E\u4E0D\u5FEB\u4E50\u7684\u4EBA\uFF0C\u4ED6\u4EEC\u90FD\u6709\u4E00\u4E9B\u5171\u540C\u7684\u5FC3\u7406\u7279\u5F81\u3002\u4ED6\u4EEC\u53EF\u80FD\u4E00\u76F4\u6CA1\u6709\u7559\u610F\uFF0C\u5C31\u662F\u4E00\u4E9B\u8111\u5B50\u91CC\u7684\u89C2\u5FF5\u548C\u60F3\u6CD5\u5BFC\u81F4\u4E86\u81EA\u5DF1\u957F\u671F\u4E0D\u5F00\u5FC3\u3002\u770B\u770B\u5FC3\u7406\u4E13\u5BB6 Tamara Star \u603B\u7ED3\u7684\uFF17\u4E2A\u5FC3\u7406\u7279\u5F81\u4E2D\uFF0C\u6709\u6CA1\u6709\u4F60\u5E38\u5E38\u6709\u7684\uFF1A</p><p><strong>\u4E00\u3001\u9ED8\u8BA4\u89C2\u70B9\uFF1A\u751F\u6D3B\u603B\u662F\u8270\u96BE\u7684</strong><br> \u3000\u3000\u5373\u4F7F\u662F\u5FEB\u4E50\u7684\u4EBA\uFF0C\u4ED6\u4EEC\u7406\u6027\u4E0A\u4E5F\u662F\u77E5\u9053\u751F\u6D3B\u6709\u65F6\u7684\u786E\u4F1A\u53D8\u5F97\u8270\u96BE\uFF0C\u4F46\u4ED6\u4EEC\u66F4\u5BB9\u6613\u7528\u4E00\u79CD\u597D\u5947\u7684\u6001\u5EA6\u6765\u89C2\u5BDF\u548C\u5EA6\u8FC7\u751F\u6D3B\u7684\u96BE\u5173\uFF0C\u770B\u770B\u751F\u6D3B\u7684\u8270\u96BE\u5230\u5E95\u4F1A\u5E26\u6765\u4EC0\u4E48\u6837\u7684\u4F53\u9A8C\u3002\u7531\u4E8E\u8FD9\u6837\u7684\u597D\u5947\u5FC3\uFF0C\u5FEB\u4E50\u7684\u4EBA\u66F4\u5BB9\u6613\u5728\u9047\u5230\u56F0\u96BE\u65F6\u628A\u7CBE\u529B\u96C6\u4E2D\u5728\u600E\u4E48\u89E3\u51B3\u56F0\u96BE\u4E0A\u3002<br> \u3000\u3000\u4E0D\u5FEB\u4E50\u7684\u4EBA\uFF0C\u5219\u662F\u4EE5\u4E00\u79CD\u751F\u6D3B\u53D7\u5BB3\u8005\u7684\u5FC3\u7406\u6765\u770B\u5F85\u751F\u6D3B\u7684\u8270\u96BE\u65F6\u523B\uFF0C\u6D88\u6781\u5730\u62B1\u6028\u5728\u751F\u6D3B\u4E2D\u7684\u4E0D\u5E78\u906D\u9047\uFF0C\u5BB9\u6613\u9677\u4E8E\u201C\u5927\u5BB6\u6765\u770B\u770B\u554A\uFF0C\u6211\u7684\u906D\u9047\u597D\u60B2\u50AC\u201D\u7684\u5FC3\u7406\uFF0C\u800C\u5FFD\u7565\u5B9E\u9645\u53BB\u89E3\u51B3\u9020\u6210\u4ED6\u4EEC\u60B2\u50AC\u7684\u95EE\u9898\u3002</p><p><strong>\u4E8C\u3001\u89C9\u5F97\u5927\u90E8\u5206\u4EBA\u90FD\u662F\u4E0D\u53EF\u4FE1\u4EFB\u7684</strong><br> \u3000\u3000\u6B63\u5E38\u7684\u8FA8\u522B\u597D\u4EBA\u548C\u574F\u4EBA\u662F\u5E94\u8BE5\u7684\uFF0C\u8FD9\u79CD\u80FD\u529B\u4E5F\u662F\u91CD\u8981\u7684\u3002<br> \u3000\u3000\u5927\u591A\u6570\u5FEB\u4E50\u7684\u4EBA\u9ED8\u8BA4\u4F1A\u76F8\u4FE1\u522B\u4EBA\u7684\uFF0C\u76F8\u4FE1\u522B\u4EBA\u662F\u597D\u5FC3\u773C\u7684\uFF0C\u76F8\u5BF9\u5730\u5BF9\u964C\u751F\u4EBA\u5F00\u653E\u800C\u53CB\u597D\uFF0C\u9664\u975E\u5DF2\u6709\u786E\u51FF\u7684\u8BC1\u636E\u8BC1\u660E\u4E00\u4E2A\u4EBA\u662F\u574F\u4EBA\uFF0C\u8BC1\u660E\u4E00\u4E2A\u4EBA\u7684\u884C\u4E3A\u662F\u51FA\u4E8E\u6076\u610F\u7684\u3002<br> \u3000\u3000\u4E0D\u5FEB\u4E50\u7684\u4EBA\u5219\u5BF9\u5927\u90E8\u5206\u4ED6\u4EEC\u9047\u5230\u7684\u964C\u751F\u4EBA\u9ED8\u8BA4\u662F\u4E0D\u4FE1\u4EFB\u7684\uFF0C\u5047\u60F3\u6BCF\u4E2A\u4EBA\u90FD\u6709\u6DF1\u6DF1\u7684\u6076\u610F\uFF0C\u5BF9\u81EA\u5DF2\u6709\u654C\u610F\uFF0C\u8981\u548C\u81EA\u5DF1\u7ADE\u4E89\u7684\u3002<br> \u3000\u3000\u4E0D\u76F8\u4FE1\u522B\u4EBA\u7684\u597D\u5904\u662F\uFF0C\u628A\u81EA\u5DF1\u4FDD\u62A4\u5F97\u5F88\u597D\uFF0C\u4E0D\u5BB9\u6613\u88AB\u9A97\uFF1B\u574F\u5904\u662F\u5931\u53BB\u5E7F\u4EA4\u670B\u53CB\u7684\u673A\u4F1A\uFF0C\u8FDE\u673A\u4F1A\u90FD\u6CA1\u6709\u3002</p><p><strong>\u4E09\u3001\u66F4\u591A\u5730\u5173\u6CE8\u8FD9\u4E2A\u4E16\u754C\u53D1\u751F\u7684\u95EE\u9898\u3001\u9519\u8BEF\u548C\u81EA\u5DF1\u770B\u4E0D\u60EF\u7684\u5730\u65B9\uFF0C\u800C\u4E0D\u662F\u5173\u6CE8\u5BF9\u7684\u3001\u597D\u7684\u3001\u79EF\u6781\u7684\u3001\u6B63\u80FD\u91CF\u7684\u4E1C\u897F</strong><br> \u3000\u3000\u5904\u4E8E\u4FE1\u606F\u65F6\u4EE3\u7684\u6211\u4EEC\uFF0C\u6BCF\u5929\u62FF\u51FA\u624B\u673A\uFF0C\u6253\u5F00QQ\uFF0C\u6BCF\u5BB9\u6613\u5C31\u83B7\u53D6\u5230\u5F88\u591A\u5012\u9709\u7684\u4FE1\u606F\uFF0C\u5730\u9707\u3001\u6D2A\u6C34\u3001\u8F66\u7978\u3001\u7206\u70B8\u3001\u7535\u68AF\u5403\u4EBA\u2026\u2026\u4F46\u5176\u5B9E\u6BCF\u5929\u9664\u4E86\u8FD9\u4E9B\u8D1F\u80FD\u91CF\u7684\u4E1C\u897F\u4E4B\u5916\uFF0C\u4ECD\u7136\u6709\u597D\u591A\u79EF\u6781\u7684\u3001\u6B63\u80FD\u91CF\u7684\u4E8B\u60C5\u53D1\u751F\u3002<br> \u3000\u3000\u4E0D\u5FEB\u4E50\u7684\u4EBA\u5F80\u5F80\u53EA\u7559\u610F\u5230\u4E86\u574F\u4E8B\u60C5\u7684\u53D1\u751F\uFF1B\u54EA\u6015\u662F\u597D\u4E8B\u60C5\uFF0C\u4E5F\u66F4\u591A\u5730\u53BB\u601D\u8003\u597D\u4E8B\u60C5\u7684\u574F\u7684\u4E00\u9762\u3002<br> \u3000\u3000\u5FEB\u4E50\u7684\u4EBA\u610F\u8BC6\u5230\u6BCF\u5929\u90FD\u6709\u574F\u4E8B\u60C5\u53D1\u751F\uFF0C\u5E76\u4E0D\u662F\u76F2\u76EE\u4E50\u89C2\u3002\u4F46\u62C5\u5FC3\u4E4B\u4F59\uFF0C\u4F1A\u7559\u4E00\u4E2A\u773C\u775B\u53BB\u5BFB\u627E\u7F8E\u597D\u7684\u4E8B\u7269\u3002</p><p><strong>\u56DB\u3001\u5C06\u81EA\u5DF1\u548C\u522B\u4EBA\u6BD4\u8F83\uFF0C\u751A\u81F3\u5AC9\u5992\u522B\u4EBA</strong><br> \u3000\u3000\u4E0D\u5FEB\u4E50\u7684\u4EBA\u662F\u7A00\u7F3A\u601D\u7EF4\uFF08Scarcity Mentality\uFF09\uFF0C\u89C9\u5F97\u4E1C\u897F\u5C31\u8FD9\u4E48\u591A\uFF0C\u4F60\u6709\u4E86\uFF0C\u6211\u5C31\u6CA1\u5566\uFF1B\u4F60\u591A\u4E86\uFF0C\u6211\u5C31\u5C11\u4E86\u3002<br> \u3000\u3000\u76F8\u53CD\uFF0C\u5FEB\u4E50\u7684\u4EBA\u62E5\u6709\u7684\u662F\u5145\u88D5\u601D\u7EF4\uFF08Abundance Mentality \uFF09\uFF0C\u4ED6\u4EEC\u770B\u5230\u522B\u4EBA\u597D\u4E86\uFF0C\u4F1A\u4E3A\u4ED6\u4EEC\u611F\u5230\u5F00\u5FC3\uFF0C\u56E0\u4E3A\u4ED6\u4EEC\u89C9\u5F97\uFF0C\u522B\u4EBA\u597D\u4E86\uFF0C\u4E5F\u662F\u8BC1\u660E\u81EA\u5DF1\u53EF\u4EE5\u53D8\u597D\u7684\u4E00\u4E2A\u8BC1\u636E\uFF0C\u673A\u4F1A\u662F\u65E0\u6B62\u5883\u7684\uFF0C\u800C\u522B\u4EBA\u4E5F\u4E0D\u80FD\u4ECE\u81EA\u5DF1\u8EAB\u4E0A\u62FF\u8D70\u81EA\u5DF1\u7684\u601D\u7EF4\u3002</p><p><strong>\u4E94\u3001\u8BD5\u56FE\u63A7\u5236\u81EA\u5DF1\u7684\u4EBA\u751F</strong><br> \u3000\u3000\u63A7\u5236\u81EA\u5DF1\u7684\u4EBA\u751F\uFF0C\u548C\u52AA\u529B\u5B9E\u73B0\u81EA\u5DF1\u7684\u76EE\u6807\u662F\u6709\u672C\u8D28\u7684\u533A\u522B\u7684\u3002<br> \u3000\u3000\u5FEB\u4E50\u7684\u4EBA\u4E5F\u5728\u6BCF\u5929\u4E3A\u81EA\u5DF1\u7684\u76EE\u6807\u594B\u6597\uFF0C\u54EA\u6015\u53EA\u662F\u6BCF\u5929\u4E00\u5C0F\u6B65\u3002\u4F46\u4ED6\u4EEC\u5FC3\u5E95\u5F88\u6E05\u695A\uFF0C\u5176\u5B9E\u4ED6\u4EEC\u6709\u65F6\u5019\u65E0\u6CD5\u5B8C\u5168\u63A7\u5236\u81EA\u5DF1\u7684\u4EBA\u751F\u7684\uFF0C\u4EBA\u751F\u4E0D\u5982\u610F\u4E8B\u5341\u6709\u516B\u4E5D\u3002\u4E8E\u662F\u5F53\u771F\u7684\u9047\u4E0A\u632B\u6298\u65F6\uFF0C\u80FD\u5766\u7136\u9762\u5BF9\uFF0C\u987A\u52BF\u800C\u4E3A\u3002<br> \u3000\u3000\u4E0D\u5FEB\u4E50\u7684\u4EBA\u591A\u5C11\u6709\u4E00\u70B9\u5B8C\u7F8E\u4E3B\u4E49\u7684\u503E\u5411\u3002\u5BF9\u4EBA\u5BF9\u5DF1\u5BF9\u751F\u6D3B\u90FD\u662F\u5982\u6B64\uFF0C\u8BD5\u56FE\u53BB\u63A7\u5236\u751F\u6D3B\u4E2D\u7684\u6BCF\u4E00\u4E2A\u5C0F\u7EC6\u8282\uFF0C\u63A7\u5236\u6BCF\u4E00\u4E2A\u7ED3\u679C\uFF0C\u751A\u81F3\u5C1D\u8BD5\u53BB\u63A7\u5236\u5468\u56F4\u7684\u4EBA\u5BF9\u81EA\u5DF1\u7684\u770B\u6CD5\u3002\u8FD9\u6837\u4E00\u6765\uFF0C\u4E00\u65E6\u751F\u6D3B\u7ED9\u51FA\u4E00\u4E2A\u8D85\u51FA\u63A7\u5236\u8303\u56F4\u7684\u7CDF\u7CD5\u7ED3\u679C\u65F6\uFF0C\u4ED6\u4EEC\u66F4\u5BB9\u6613\u53D7\u5230\u6253\u51FB\uFF0C\u6C14\u9981\u3002</p><p><strong>\u516D\u3001\u8FC7\u591A\u5730\u62C5\u5FC3\u548C\u5BB3\u6015\u81EA\u5DF1\u7684\u672A\u6765</strong><br> \u3000\u3000\u5408\u7406\u7684\u62C5\u5FC3\u548C\u9884\u9632\uFF0C\u5BF9\u4E8B\u60C5\u7684\u6210\u529F\u81F3\u5173\u91CD\u8981\u3002\u4F46\u4EBA\u7684\u8111\u5BB9\u6613\u5C31\u90A3\u4E48\u591A\uFF0C\u5982\u679C\u8BA9\u62C5\u5FC3\u548C\u5BB3\u6015\u90FD\u5145\u6EE1\u81EA\u5DF1\u7684\u8111\u888B\uFF0C\u5C31\u4F1A\u5F71\u54CD\u81EA\u5DF1\u7684\u5224\u65AD\uFF0C\u66F4\u5F71\u54CD\u60C5\u7EEA\u3002<br> \u3000\u3000\u6B63\u786E\u7684\u505A\u6CD5\uFF0C\u9047\u5230\u62C5\u5FC3\u548C\u5BB3\u6015\u65F6\uFF0C\u8981\u5148\u533A\u5206\uFF0C\u54EA\u4E9B\u662F\u5FC3\u7406\u4E0A\u8FC7\u591A\u5730\u60F3\u8C61\u5BFC\u81F4\u5BB3\u6015\uFF0C\u54EA\u4E9B\u662F\u76F4\u6B63\u9762\u4E34\u7684\u56F0\u96BE\uFF1B\u7136\u540E\u8003\u8651\u81EA\u5DF1\u8FD8\u6709\u4EC0\u4E48\u724C\u53EF\u4EE5\u6253\uFF0C\u80FD\u505A\u4E9B\u4EC0\u4E48\u53BB\u9884\u9632\u53EF\u80FD\u53D1\u751F\u7684\u95EE\u9898\uFF0C\u91C7\u53D6\u5B9E\u9645\u884C\u52A8\uFF0C\u505A\u5B8C\u8FD9\u4E9B\u4E8B\u60C5\u540E\uFF0C\u5C31\u5E94\u8BE5\u6487\u5F00\u8FD9\u4E9B\u8BA9\u81EA\u5DF1\u4E0D\u6109\u5FEB\u7684\u60C5\u7EEA\uFF0C\u4E0D\u8981\u8BA9\u4ED6\u4EEC\u5F71\u54CD\u5176\u4ED6\u7684\u5DE5\u4F5C\u548C\u751F\u6D3B\u3002</p><p><strong>\u4E03\u3001\u8FC7\u591A\u5730\u62B1\u6028\u548C\u8C08\u8BBA\u81EA\u5DF1\u7684\u4E0D\u5E78\u548C\u4ED6\u4EBA\u7684\u4E0D\u5E78</strong><br> \u3000\u3000\u4E0D\u5FEB\u4E50\u7684\u4EBA\u503E\u5411\u4E8E\u6D3B\u5728\u8FC7\u53BB\u7684\u4E0D\u5E78\uFF0C\u4EE5\u524D\u53D1\u751F\u7684\u4E0D\u5E78\uFF0C\u751F\u6D3B\u7684\u8270\u96BE\u56F0\u82E6\uFF0C\u5F80\u5F80\u662F\u4ED6\u4EEC\u804A\u5929\u7684\u4E3B\u8981\u8BDD\u9898\u3002\u5F53\u81EA\u5DF1\u7684\u4E0D\u5E78\u8BB2\u5B8C\u4E86\uFF0C\u53C8\u5F00\u59CB\u8BB2\u8D77\u522B\u4EBA\u7684\u4E0D\u5E78\u3002<br> \u3000\u3000\u8981\u505A\u5FEB\u4E50\u7684\u4EBA\uFF0C\u5F97\u5B66\u4F1A\u6D3B\u5728\u5F53\u4E0B\uFF0C\u68A6\u5728\u672A\u6765\u3002</p>',10),n=[s];function p(c,_,b,i,d,g){return t(),e("div",null,n)}const h=r(a,[["render",p]]);export{S as __pageData,h as default};
